The poll on my story has spoken, had to post this routine 😅 @deepakdugarmd said I can’t get my cast wet, but I’m too skin-oriented to not at least try and keep a normal routine while I recover from my @scarlessnose job. I’m going to add my journey to a permanent memory for those who are curious. 
Products I used: 
@skinceuticals Discoloration Defense
@skinceuticals Retinal 1.0
@zoskinhealth pigment control
@lamer creme de la mer
@lamer renewal oil 
Washed my face beforehand with @isclinical cleansing complex (I got everything from @roxspabh, @beverlyhillsskin created this cocktail for my skin/needs)
